    "integrated-pest-management-plan-for-chesapeake-marshlands-national-wildlife-refuge-complex",nt"isopen":
    false,nt"url": null,nt"notes": "With this Integrated Pest Management Plan,
    the Chesapeake Marshlands National Wildlife Refuge Complex aims to demonstrate land
    stewardship in controlling invasive plants and other pests, while striving towards
    the goal of restoring native habitats and fauna, thereby re-establishing the health
    of the refuge ecosystem. The Integrated Pest Management Plan treatments were selected
    to control pests according to the refuge's various site and soil types, with special
    attention to resource needs. This Plan also includes prevention strategies employed
    by the Fish and Wildlife Service, such as conducting invasive weed surveys along
    roads, trails and rivers to detect new infestations, and prioritizing and managing
    these weed infestations to prevent its spread to new areas.",nt"license_title":
